import React from "react";
import "../pages.css";
import { useState, useEffect } from "react";
import Header from "../components/header";
import axios from "axios";


const JobPosts = () => {
  const [jobs, setJobs] = useState([]);
  const [errors, setErrors] = useState("");

  const date = new Date();


  const jobDetail = (event) => {

  }

  useEffect(() => {
    axios
      .get("http://127.0.0.1:1111/api/v1/job-listings/")
      .then((response) => {
        setJobs(response.data);
      })
      .catch((error) => {
        setErrors(error.message);
      });
  }, []);

  if (errors) {
    return (
      <>
        <Header />
        <p>{errors}</p>
      </>
    );
  }

  return (
    <>
      <Header />
      <h1 style={{ padding: "20px" }}>Available jobs for you</h1>

      <ul>
        {jobs.map((job) => (
          <li key={job.id}>
            <div className="jobs-post" style={{ padding: "20px" }} onClick={jobDetail(job.id)}>
              <h3>Job Title: {job.job_title}</h3>
              <p style={{ paddingTop: "10px" }}>{job.job_description}</p> 
              <h3 style={{ paddingTop: "5px" }}>Enumeration: {job.enumeration}</h3>
              <small>posted on {date.toUTCString()}</small>

            </div>
            < hr />
          </li>
        ))}

        <p style={{ marginTop: "100px", marginLeft: "20px",}}> You are all caugt up....</p>
      </ul>
    </>
  );
};

export default JobPosts;
